        <style type="text/css">
            .login-container {
                position: absolute;
                margin: 80px auto;
                padding: 20px 20px 20px;
                text-align: center;
                background: #f5f5f5;
                border: 1px solid #ccc
            }

            #output {
                position: absolute;
                width: 400px;
                top: -75px;
                left: 0;
                color: #fff
            }

            #output.alert-success {
                background-image: https://i.imgur.com/fktvunG.png
            }

            #output.alert-danger {
                background-image: https://i.imgur.com/fktvunG.png
            }

            .avatar {
                width: 100px;
                height: 100px;
                margin: 10px auto -30px;
                border-radius: 100%;
                border: 2px solid #aaa;
                background-size: cover
            }

            .form-box input {
                width: 100%;
                margin: 8px;
                text-align: center;
                height: 40px;
                border: 1px solid #ccc;
                background: #fff;
                transition: .2s ease-in-out
            }

            .form-box input:focus {
                outline: 50px;
                background: #fff
            }

            .form-box input[type=text] {
                border-radius: 5px 5px 0 0;
                text-transform: lowercase
            }

            .form-box input[type=password] {
                border-radius: 0;
                border-top: 0
            }

            .form-box button.login {
                margin-top: 15px;
                padding: 10px 20px
            }

            .animated {
                -webkit-animation-duration: 1s;
                animation-duration: 1s;
                -webkit-animation-fill-mode: both;
                animation-fill-mode: both
            }

            @-webkit-keyframes fadeInUp {
                0% {
                    opacity: 0;
                    -webkit-transform: translateY(20px);
                    transform: translateY(20px)
                }

                100% {
                    opacity: 0;
                    -webkit-transform: translateY(0);
                    transform: translateY(0)
                }
            }

            @keyframes fadeInUp {
                0% {
                    opacity: 0;
                    -webkit-transform: translateY(20px);
                    -ms-transform: translateY(20px);
                    transform: translateY(20px)
                }

                100% {
                    opacity: 1;
                    -webkit-transform: translateY(0);
                    -ms-transform: translateY(0);
                    transform: translateY(0)
                }
            }

            .fadeInUp {
                -webkit-animation-name: fadeInUp;
                animation-name: fadeInUp
            }
        </style>

            body {

                background-size: cover;

        <style>
            body, html {
                height: 100%;
                margin: 0;
                font-family: Arial, Helvetica, sans-serif;
            }

            * {
                box-sizing: border-box;
            }

            .bg-image {
                /* The image used */
                background-image: url("https://i.imgur.com/fktvunG.png");
                /* Add the blur effect */
                filter: blur(4px);
                -webkit-filter: blur(4px);
                /* Full height */
                height: 100%;
                /* Center and scale the image nicely */
                background-position: center;
                background-repeat: no-repeat;
                background-size: cover;
            }

            /* Position text in the middle of the page/image */
            .bg-text {
                background-color: rgb(0,0,0);
                /* Fallback color */
                background-color: rgba(0, 77, 0, 0.8);
                /* Black w/opacity/see-through */
                color: white;
                font-weight: bold;
                border: 1px solid #0FFFFFF;
                position: absolute;
                top: 50%;
                left: 50%;
                transform: translate(-50%, -50%);
                border-radius: 10px 30px;
                z-index: 2;
                width: 400px;
                height: 320px;
                padding: 20px;
                text-align: center;
                -webkit-box-shadow: 5px 5px 7px 4px rgba(0,0,0,0.71);
                box-shadow: 5px 5px 7px 4px rgba(0,0,0,0.71);
            }
        </style>
